import PropTypes from "prop-types";

function UploadSymbol({ colorProp }) {
  return (
    <svg
      width="16"
      height="16"
      viewBox="0 0 16 16"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
    >
      <path
        d="M15.125 10.1923V12.9327C15.125 14.1435 14.1435 15.125 12.9327 15.125H3.06731C1.85653 15.125 0.875 14.1435 0.875 12.9327V10.1923M8 11.8365V0.875M8 0.875L4.71154 4.16346M8 0.875L11.2885 4.16346"
        stroke="white"
        stroke-width="1.5"
        stroke-linecap="round"
        stroke-linejoin="round"
      />
    </svg>
  );
}
export default UploadSymbol;
UploadSymbol.propTypes = {
  colorProp: PropTypes.string,
};
UploadSymbol.defaultProps = {
  colorProp: "#3C7CAF",
};
